    criteria. The purpose of this class is to take the .Current element of each iterator

    and pass it to the <xref href="SuperOffice.CRM.ArchiveLists.ArchiveRowComparer" data-throw-if-not-resolved="false"></xref>, which handles the actual work.

    All remarks for that class are valid here as well.
